import React, { Component } from 'react';
import { connect } from 'react-redux';
//import { } from '../../redux/action-creators';
import { create } from 'domain';
import { withRouter } from 'react-router-dom';

class CreateUser extends React.Component {
  constructor(props) {
    super(props);
    this.state = { searchText: '' };
  }

  routeAdd() {
    let path = `http://localhost:8080/api/`;
    this.props.history.push(path);
  }

  render() {
    return (
      <div className = 'container'>
        <h2>Edit User</h2>
        <form>
          First Name: <input type = 'text' name = 'firstname'/>
          Last Name: <input type = 'text' name = 'lastname'/>
          Sex: <input type = 'text' name = 'sex'/>
          Age: <input type = 'text' name = 'age'/>
          Password: <input type = 'text' name = 'password'/>
          Password Repeat: <input type = 'text' name = 'password'/>
        </form>
        <button onClick={this.routeAdd}>Add User</button> 
      </div>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    users: state.getUsers.data
  }
};

const mapDispatchToProps = (dispatch) => {
  return {
    getUsers: () => {
      dispatch(getUsers());
    },
  }
};

export default connect((mapStateToProps, mapDispatchToProps),withRouter(CreateUser));
